    [],nt"revision_timestamp": "2016-07-27T23:06:22.739757",nt"name": "evaluation-of-ozone-injury-on-vegetation-in-the-moosehom-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "In 1978, Moosehorn Wilderness was designated
    a Class I air quality area, receiving further protection under the Clean Air Act.
    Congress gave FWS and the other Federal land managers for Class I areas an "affirmative
    responsibility to protect all those air quality related values (including visibility)
    of such lands ... " Air quality related values include vegetation, wildlife, water,
    soils, visibility, and cultural resources. Despite this special protection, many
    of the resources in these wilderness areas are being impacted or have the potential
    to be impacted by air pollutants. Because many air pollutants can be carried long
    distances in the atmosphere, even rural and remote areas are affected by air pollution,
    including manywilderness areas.  To better understand how air pollution affects
    resources at the Moosehorn NWR,surveys were conducted in 1998 to evaluate ozone
    injury to vegetation within the refuge.  Objectives:  1) To identify ozone sensitive
    plant species in the Moosehom NWR and 2) To evaluate incidence and severity of ozone
    injury on vegetation in the Moosehorn NWR.",nt"license_title": "License Not
